import React from 'react';
import Map from './Map';

const App: React.FC = () => {
  return (
    <>
      {/* Header */}
      <div className="">
        <h1 style={{ fontFamily: 'era', textAlign: 'center' }}>TAYLOR SWIFT: THE ERAS TOUR</h1>
        <h1 style={{ fontFamily: 'era', textAlign: 'center' }}>Next Tour Location</h1>
      </div>

      <div className="flex flex-col md:flex-row m-10" style={{ backgroundColor: 'whitesmoke' }}>
        <div className="m-10 p-5 bg-white shadow-md">
          <img className="flex md:col-3" src="./images/eras-tour-poster.png" alt="Eras Tour" width="20%" />
        </div>

        <div className="m-10 p-5 bg-white shadow-md">
          <Map />
        </div>
      </div>
    </>
  );
};

export default App;
